import React, { useEffect, useState } from "react";
import axios from "axios";

const Menu = () => {
  const [parcels, setParcels] = useState([]);
  const [selectedState, setSelectedState] = useState("");
  const [selectedDistrict, setSelectedDistrict] = useState("");
  const [selectedTaluk, setSelectedTaluk] = useState("");
  const [selectedHobli, setSelectedHobli] = useState("");
  const [selectedVillage, setSelectedVillage] = useState("");

  useEffect(() => {
    // Fetch all parcels using Axios
    axios
      .get("http://127.0.0.1:5000/parcel")
      .then((response) => {
        if (!response.data) {
          throw new Error("Empty response or response data is not valid JSON");
        }
        console.log("Fetched data:", response.data); // Log the fetched data
        setParcels(response.data);
      })
      .catch((error) => console.error("Error fetching parcels:", error));
  }, []);

  const getOptionsByParentId = (parentId) => {
    return parentId
      ? parcels.filter((parcel) => parcel.parentId === parentId)
      : [];
  };

  const stateOptions = parcels
    .filter((parcel) => !parcel.parentId)
    .map((parcel) => (
      <option key={parcel.id} value={parcel.id}>
        {parcel.name}
      </option>
    ));

  const districtOptions = getOptionsByParentId(selectedState).map((parcel) => (
    <option key={parcel.id} value={parcel.id}>
      {parcel.name}
    </option>
  ));

  const talukOptions = getOptionsByParentId(selectedDistrict).map((parcel) => (
    <option key={parcel.id} value={parcel.id}>
      {parcel.name}
    </option>
  ));

  const hobliOptions = getOptionsByParentId(selectedTaluk).map((parcel) => (
    <option key={parcel.id} value={parcel.id}>
      {parcel.name}
    </option>
  ));

  const villageOptions = getOptionsByParentId(selectedHobli).map((parcel) => (
    <option key={parcel.id} value={parcel.id}>
      {parcel.name}
    </option>
  ));

  return (
    <div className="menu">
      <div className="container">
        <h1>Select the Farm</h1>
        <label htmlFor="stateDropdown">Select State:</label>
        <select
          className="select"
          id="stateDropdown"
          value={selectedState}
          onChange={(e) => {
            setSelectedState(e.target.value);
            setSelectedDistrict("");
            setSelectedTaluk("");
            setSelectedHobli("");
            setSelectedVillage("");
          }}
        >
          <option value="">Select State</option>
          {stateOptions}
        </select>

        <label htmlFor="districtDropdown">Select District:</label>
        <select
          className="select"
          id="districtDropdown"
          value={selectedDistrict}
          onChange={(e) => {
            setSelectedDistrict(e.target.value);
            setSelectedTaluk("");
            setSelectedHobli("");
            setSelectedVillage("");
          }}
        >
          <option value="">Select District</option>
          {districtOptions}
        </select>

        <label htmlFor="talukDropdown">Select Taluk:</label>
        <select
          className="select"
          id="talukDropdown"
          value={selectedTaluk}
          onChange={(e) => {
            setSelectedTaluk(e.target.value);
            setSelectedHobli("");
            setSelectedVillage("");
          }}
        >
          <option value="">Select Taluk</option>
          {talukOptions}
        </select>

        <label htmlFor="hobliDropdown">Select Hobli:</label>
        <select
          className="select"
          id="hobliDropdown"
          value={selectedHobli}
          onChange={(e) => {
            setSelectedHobli(e.target.value);
            setSelectedVillage("");
          }}
        >
          <option value="">Select Hobli</option>
          {hobliOptions}
        </select>

        <label htmlFor="villageDropdown">Select Village:</label>
        <select
          className="select"
          id="villageDropdown"
          value={selectedVillage}
          onChange={(e) => setSelectedVillage(e.target.value)}
        >
          <option value="">Select Village</option>
          {villageOptions}
        </select>
      </div>
    </div>
  );
};

export default Menu;
